import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';

import SignIn from './pages/signin';
import SignUp from './pages/signup';
import ForgotPassword from './pages/forgotpasseword';

import DashboardUserLayout from './layouts/DashboardUserLayout';
import Home from './pages/Home';
import CommentCaMarche from './pages/CommentCaMarche';
import ImporterDonnees from './pages/ImporterDonnees';
import Historique from './pages/Historique';
import MonCompte from './pages/MonCompte';

// Route privée qui redirige vers / si l'utilisateur n'est pas connecté
const PrivateRoute = ({ element }) => {
  const { user } = useAuth();
  return user ? element : <Navigate to="/" />;
};

// Redirige vers /dashboard si déjà connecté
const RedirectIfAuthenticated = ({ element }) => {
  const { user } = useAuth();
  return user ? <Navigate to="/dashboard" /> : element;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Page de démarrage (connexion) */}
          <Route path="/" element={<RedirectIfAuthenticated element={<SignIn />} />} />

          {/* Authentification */}
          <Route path="/signin" element={<RedirectIfAuthenticated element={<SignIn />} />} />
          <Route path="/signup" element={<RedirectIfAuthenticated element={<SignUp />} />} />
          <Route path="/forgotpasseword" element={<ForgotPassword />} />

          {/* Tableau de bord (protégé) */}
          <Route element={<PrivateRoute element={<DashboardUserLayout />} />}>
            <Route path="/dashboard" element={<Home />} />
            <Route path="/dashboard/comment-ca-marche" element={<CommentCaMarche />} />
            <Route path="/dashboard/importer" element={<ImporterDonnees />} />
            <Route path="/dashboard/historique" element={<Historique />} />
            <Route path="/dashboard/mon-compte" element={<MonCompte />} />
          </Route>
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
